import { useState } from "react"

    const [Data, setData] = useState([{data:[], next:[]}])


export default function ReadData(API){
    fetch(API)
    .then((res)=>res.json())
    .then((data)=>{
           setData(prev=> ({ data: data.data,   next: data.links.next ,  }))}) 
    }
